class Solution {
public:
    int prefixCount(vector<string>& words, string pref) {
        int result = 0;
        bool isAns = true;
        for (string &word: words) {
            if (word.size() < pref.size())
                continue;

            for (int i=0; i<pref.size(); i++) {
                if (word[i] != pref[i])
                {
                    isAns = false;
                    break;
                }
                else
                {
                    isAns = true;
                }            
            }

            if (isAns)
                result++;


        }
        return result;
    }
};

