class Solution {
public:
    int minSteps(string s, string t) {
        unordered_map<char, int> umap1;
        unordered_map<char, int> umap2;

        for (char &c: s) {
            umap1[c]++;
        }
        for (char &c: t) {
            umap2[c]++;
        }
        int result = 0;

        for (char &c: t) {
            if (umap1.count(c) > 0) {
                umap1[c]--;
                if (umap1[c] == 0)
                    umap1.erase(c);
            }
            else {
                result++;
            }
        }
        for (char &c: s) {
            if (umap2.count(c) > 0) {
                umap2[c]--;
                if (umap2[c] == 0)
                    umap2.erase(c);
            }
            else {
                result++;
            }
        }
        return result;

    }
};
